import React from 'react';

const FaceRecognition=({imageUrl})=>{
    if(!imageUrl){
        return(<div className="center ">Please Copy Paste Link Above</div>)
    }else{     
    return(
        <div className='center image'>
            <img 
                src={imageUrl}
                alt="han solo"
            />
        </div>
    )}

}


export default FaceRecognition;
